    super()
    this.state = {
      canavar1:{
        name:"Linda"
      },
      canavar2:{
        name:"Frank"
      },
      canavar3:{
        name:"Jackie"
      }
    }
  } 
  render(){  
  return (
    <div className="App">
<h1>{this.state.canavar1.name}</h1>
<h1>{this.state.canavar2.name}</h1>
<h1>{this.state.canavar3.name}</h1>
    </div>
  );
}
}

export default App;
